// client/src/components/ServiceCardsDetails.js
import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import styled from 'styled-components';

// Estiliza√ß√£o usando styled-components
const Container = styled.div`
  max-width: 800px;
  margin: 2rem auto;
  padding: 2rem;
  background-color: #f9f9f9;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  transition: transform 0.3s;

  &:hover {
    transform: scale(1.02);
  }
`;

const BackButton = styled.button`
  background: none;
  border: none;
  cursor: pointer;
  font-size: 1.5rem;
  color: #2980b9;
  margin-bottom: 1rem;

  &:hover {
    color: #1a5276;
  }
`;

const Title = styled.h1`
  font-size: 2.5rem;
  color: #2c3e50;
  margin-bottom: 1rem;
  text-align: center; /* Centraliza o t√≠tulo */
`;

const Description = styled.p`
  font-size: 1.2rem;
  color: #34495e;
  margin-bottom: 1.5rem;
`;

const SectionTitle = styled.h2`
  font-size: 2rem;
  color: #2980b9;
  margin-top: 2rem;
  margin-bottom: 1rem;
`;

const Details = styled.p`
  font-size: 1rem;
  color: #7f8c8d;
  line-height: 1.6;
`;

const BenefitsList = styled.ul`
  list-style-type: disc;
  margin-left: 1.5rem;
  color: #34495e;
`;

const BenefitItem = styled.li`
  margin-bottom: 0.5rem;
`;

const IconContainer = styled.div`
  font-size: 3rem; /* Tamanho do √≠cone */
  text-align: center; /* Centraliza o √≠cone */
  margin-bottom: 1rem; /* Espa√ßamento abaixo do √≠cone */
`;

const ServiceDetailPage = () => {
  const { title } = useParams(); // Obter o t√≠tulo do servi√ßo da URL
  const navigate = useNavigate(); // Hook para navega√ß√£o

  // Aqui voc√™ pode buscar os detalhes do servi√ßo com base no t√≠tulo
  const services = [
    {
      title: "Odontologia Geral",
      description: "Tratamentos completos para manter a sua sa√∫de bucal em dia.",
      details: "A odontologia geral abrange uma variedade de servi√ßos, incluindo limpeza, restaura√ß√µes, extra√ß√µes e exames regulares. Nossos dentistas est√£o equipados para lidar com todas as suas necessidades de sa√∫de bucal.",
      benefits: [
        "Preven√ß√£o de doen√ßas bucais",
        "Melhoria da sa√∫de geral",
        "Tratamentos personalizados"
      ],
      additionalInfo: "A consulta regular com um dentista √© essencial para manter a sa√∫de bucal. Recomendamos visitas a cada seis meses.",
      icon: "fas fa-tooth",
    },
    {
      title: "ortodontia",
      description: "Corre√ß√£o do alinhamento dos dentes.",
      details: "A ortodontia √© especializada na corre√ß√£o de dentes e mand√≠bulas desalinhados. Usamos aparelhos modernos e discretos para garantir que voc√™ tenha um sorriso bonito e saud√°vel.",
      benefits: [
        "Melhora na est√©tica do sorriso",
        "Facilita a higiene bucal",
        "Reduz o risco de problemas dent√°rios futuros"
      ],
      additionalInfo: "Os tratamentos ortod√¥nticos podem durar de 6 meses a 2 anos, dependendo da complexidade do caso.",
      icon: "üòÅ" // √çcone associado ao servi√ßo
    },
    {
      title: "implantes-dentarios",
      description: "Substitua dentes perdidos com implantes.",
      details: "Os implantes dent√°rios s√£o uma solu√ß√£o permanente para dentes perdidos. Eles s√£o projetados para se parecer e funcionar como dentes naturais, proporcionando conforto e funcionalidade.",
      benefits: [
        "Solu√ß√£o duradoura",
        "Melhora na mastiga√ß√£o",
        "Aumenta a autoestima"
      ],
      additionalInfo: "Os implantes s√£o feitos de tit√¢nio, um material biocompat√≠vel que se integra ao osso.",
      icon: "üî©" // √çcone associado ao servi√ßo
    },
    {
      title: "endodontia",
      description: "Tratamento de canal especializado.",
      details: "A endodontia √© o tratamento de problemas relacionados √† polpa dent√°ria. Nossos especialistas garantem que voc√™ esteja confort√°vel durante todo o processo.",
      benefits: [
        "Al√≠vio da dor",
        "Preserva√ß√£o do dente natural",
        "Tratamento eficaz"
      ],
      additionalInfo: "O tratamento de canal pode salvar um dente que, de outra forma, precisaria ser extra√≠do.",
      icon: "‚úÖ" // √çcone associado ao servi√ßo
    },
    {
      title: "estetica-dental",
      description: "Procedimentos para melhorar a apar√™ncia do seu sorriso.",
      details: "A est√©tica dental inclui uma variedade de tratamentos, como clareamento, facetas e restaura√ß√µes est√©ticas, para ajudar voc√™ a alcan√ßar o sorriso dos seus sonhos.",
      benefits: [
        "Sorriso mais brilhante",
        "Aumento da confian√ßa",
        "Resultados personalizados"
      ],
      additionalInfo: "Os tratamentos est√©ticos s√£o personalizados para atender √†s suas necessidades e desejos espec√≠ficos.",
      icon: "‚ú®" // √çcone associado ao servi√ßo
    },
    {
      title: "odontopediatria",
      description: "Cuidados dent√°rios especializados para crian√ßas.",
      details: "A odontopediatria √© focada na sa√∫de bucal de crian√ßas e adolescentes. Criamos um ambiente acolhedor e divertido para que as crian√ßas se sintam confort√°veis durante as consultas.",
      benefits: [
        "Cuidados preventivos",
        "Educa√ß√£o sobre higiene bucal",
        "Tratamentos adaptados para crian√ßas"
      ],
      additionalInfo: "As consultas regulares ajudam a estabelecer h√°bitos saud√°veis desde cedo.",
      icon: "üë∂" // √çcone associado ao servi√ßo
    }
  ];

  const service = services.find(s => s.title === title); // Encontrar o servi√ßo pelo t√≠tulo

  return (
    <Container>
      <BackButton onClick={() => navigate(-1)}>&larr; Voltar</BackButton> {/* Bot√£o de voltar */}
      {service ? (
        <>
          <IconContainer>{service.icon}</IconContainer> {/* √çcone acima do t√≠tulo */}
          <Title>{service.title.replace(/-/g, ' ')}</Title>
          <Description>{service.description}</Description>
          <SectionTitle>Detalhes</SectionTitle>
          <Details>{service.details}</Details>
          <SectionTitle>Benef√≠cios</SectionTitle>
          <BenefitsList>
            {service.benefits.map((benefit, index) => (
              <BenefitItem key={index}>
                {service.icon} {benefit} {/* Renderizando o √≠cone associado ao servi√ßo */}
              </BenefitItem>
            ))}
          </BenefitsList>
          <SectionTitle>Informa√ß√µes Adicionais</SectionTitle>
          <Details>{service.additionalInfo}</Details>
        </>
      ) : (
        <p>Servi√ßo n√£o encontrado.</p>
      )}
    </Container>
  );
};

export default ServiceDetailPage;
